import React, { Component } from 'react'

export default class Tournaments extends Component {

    constructor(props){
        super(props);
        this.state={tournaments:[]}
    }

    componentDidMount(){
        console.log("i am mounted");
        const url = "http://www.localhost:8000/tennis/";
        fetch(url,{
            method:'GET',
            headers:{
                'content-type':'application/json'
            }
        })
        .then(data => this.setState({tournaments:data}));
    }


    render() {
        const tournamentItems=() => { this.state.tournaments.map((tournament) => {
            <div>{tournament.event_name}</div>
        })};

        return (<div>{tournamentItems}</div>);
    }

}
